import React from 'react';
import { Container, Row, Col } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";
import "./Footer.css";

function Footer() {
    return (
        <div>
						<section className="footer">
							<Container fluid>
								<Row>
									<Col md={4}>
										<h3>About Company</h3>
										<img src="/public/assets/office-image.jpg" alt="About Company"/>
										<p>We will be providing free counseling to the students, parents, and Guardians by our productive and experienced consultants.</p>
										<button>Get In Touch!</button>
									</Col>
								</Row>
							</Container>
						</section>
        </div>
    )
}

export default Footer
